import React from "react";
import { createBrowserRouter, RouterProvider } from 'react-router-dom';

import Register from '../Register/Register';
import LoginForm from '../Login/LoginForm';
import Homepage from '../Homepage/Homepage';
import Booking from '../Booking/Booking';
import CusData from '../CusData/CusData';
import Housing from '../Housing/Housing';
import Planner from '../Planner/Planner';
import HousingEdit from '../Housing/HousingEdit/HousingEdit';
import HousingAdd from '../Housing/HousingAdd/HousingAdd';
import HousingDel from '../Housing/HousingDel/HousingDel';
import TypeEdit from "../Housing/TypeEdit/TypeEdit";
import TypeAdd from "../Housing/TypeAdd/TypeAdd";
import AboutUs from '../AboutUS/AboutUs';
import RootLayout from './Root';
import Errorpage from './Error';

  // const routerDefinitions = createRoutesFromElements(
  //   <Route>
  //     <Route path="/" element={<Homepage />}/>
  //     <Route path="/Login" element={<Login />}/>
  //     <Route path="/Register" element={<Register />}/>
  //   </Route>
  // );

  // const router = createBrowserRouter(routerDefinitions);

const router = createBrowserRouter([
    {
      path: '/',
      element: <RootLayout/>,
      errorElement: <Errorpage/>, 
      children: [
            { path: '/', element: <Homepage />},
            { path: '/Booking', element: <Booking />},
            { path: '/CusData', element: <CusData />},
            { path: '/Housing', element: <Housing />},
            { path: '/Planner', element: <Planner />},
            { path: '/HousingEdit', element: <HousingEdit />},
            { path: '/AboutUs', element: <AboutUs />},
            { path: '/HousingAdd', element: <HousingAdd />},
            { path: '/HousingDel', element: <HousingDel />},
            { path: '/TypeEdit', element: <TypeEdit />},
            { path: '/TypeAdd', element: <TypeAdd />},
            { path: '/Register', element: <Register />},
            { path: '/LoginForm', element: <LoginForm />},
          
      ],
    },

  ]);
 const Routers = () => {

  return (
    <RouterProvider router={router}/>

  );
}

export default Routers;
